int getNext(const char trg, const string &t, const int tpos) {
    for (int i = tpos; i < t.size(); ++i) {
        if (t[i] == trg)
            return i;
    }
    return t.size();
}

bool isSubsequence(string s, string t) {
    if (s.empty())
        return true;
    if (t.empty())
        return false;
    const int ssize = s.size();
    const int tsize = t.size();
    int spos = 0;
    int tpos = 0;
    while (tpos < tsize) {
        tpos = getNext(s[spos], t, tpos);
        char checkChar = t[tpos];
        if (tpos < tsize)
            ++spos;
        if (spos == ssize)
            return true;
    }
    return false;
}


